import { useSelector } from "react-redux";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import Button from "react-bootstrap/Button";

function Navigation() {
  const islogin = useSelector((state) => state.auth.isAuthenticated);
  return (
    <>
      <Navbar
        expand="lg"
        className="bg-body-tertiary"
        bg="black"
        data-bs-theme="dark"
      >
        <Container>
          <Navbar.Brand
            href="/"
            style={{
              fontSize: "2.5rem",
              marginRight: "6rem",
            }}
          >
            Trippy Cars
          </Navbar.Brand>
          {islogin && (
            <>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto">
                  <Link
                    to="/"
                    style={{
                      textDecoration: "none",
                      color: "white",
                      fontSize: "1.25rem",
                      marginTop: "15px",
                    }}
                  >
                    Home
                  </Link>
                </Nav>
                <Nav className="me-auto">
                  <Link
                    to="/"
                    style={{
                      textDecoration: "none",
                      color: "white",
                      fontSize: "1.25rem",
                      marginTop: "15px",
                    }}
                  >
                    Bookings
                  </Link>
                </Nav>
                <Nav className="me-auto">
                  <Link
                    to="/"
                    style={{
                      textDecoration: "none",
                      color: "white",
                      fontSize: "1.25rem",
                      marginTop: "15px",
                    }}
                  >
                    Become a Host
                  </Link>
                </Nav>
                <Nav className="me-auto">
                  <Link
                    to="/"
                    style={{
                      textDecoration: "none",
                      color: "white",
                      fontSize: "1.25rem",
                      marginTop: "15px",
                    }}
                  >
                    Your Car
                  </Link>
                </Nav>
                <Nav>
                  <Button variant="outline-light">Light</Button>
                </Nav>
              </Navbar.Collapse>
            </>
          )}
        </Container>
      </Navbar>
    </>
  );
}
export default Navigation;
